    const CHOSEN_COLOR = "#e96e5b"
    let innerHeight = window.innerHeight

    window.addEventListener("scroll", function () {
      console.log(document.documentElement.scrollTop, innerHeight)
      if (document.documentElement.scrollTop < innerHeight) {
        document.querySelector(".found-counter").classList.remove("hid")
      } else {
        document.querySelector(".found-counter").classList.add("hid")
      }
      if (document.documentElement.scrollTop > 80) {
        document.querySelector(".found-counter").style.top = "60px";
      } else {
        document.querySelector(".found-counter").style.top = "100px";
      }
    })


    this.brainParts.forEach((part) => {
      console.log(part)
      let curr = document.querySelectorAll(`.${part}`);
      let clicked = ""
      curr.forEach((item) => {
        let fill = item.style.fill
            item.addEventListener("mouseover", function () {
              if (clicked !== part) {
                curr.forEach((c) => c.style.fill = HOVER_COLOR)
              }
            })
            item.addEventListener("mouseout", function () {
              if (clicked !== part) {
                curr.forEach((c) => c.style.fill = fill)
              }
            })
            item.addEventListener("click", function () {
              if (clicked === part) {
                curr.forEach((c) => c.style.fill = fill)
                clicked = ""
              } else {
                clicked = part
                curr.forEach((c) => c.style.fill = CHOSEN_COLOR)
              }
            })
          }
      )
    })

  },
  methods: {
    clickEvent(elem) {
      if (!this.clicked.includes(elem)) {
        this.clicked.push(elem);
        this.found++;
      }
      this.checking = false
      this.isClicked = true;
      this.currentQuestion = this.questionsArray[Math.floor(Math.random() * this.questionsArray.length)]
      this.currentAnswer = elem
    },
    checkAnswer() {
      this.checking = true
      document.querySelector(".question-card").style.backgroundColor = this.answerColor;
      let curr = document.querySelectorAll(`.${this.currentAnswer}`)
      console.log(curr)
      if (this.answerColor === "#b2fcbb") {
        this.rights.push(this.currentAnswer);
        curr.forEach((item) => {
          item.removeEventListener("click", function () {
          }, false);
          item.removeEventListener("mouseover", function () {
          }, false);
          item.removeEventListener("mouseout", function () {
          }, false);
          item.style.fill = "#b2fcbb";
          item.classList.add("trueInput");
        })
      } else {
        this.wrongs.push(this.currentAnswer)
        curr.forEach((item) => {
          item.removeEventListener("click", function () {
          }, false);
          item.removeEventListener("mouseover", function () {
          }, false);
          item.removeEventListener("mouseout", function () {
          }, false);
          item.style.fill = "#e32d3f"
          item.classList.add("falseInput")
        })
      }
    },
    getDone() {
      let rights = this.rights;
      let wrongs = this.wrongs;
      rights.forEach((right) => {
        if (wrongs.includes(rights)) {
          rights.splice(rights.indexOf(right))
        }
      })
      this.brainParts.forEach((part) => {
        if (!rights.includes(part) || !wrongs.includes(part)) {
          wrongs.push(part)
        }
      })
      this.$emit("done", {who: "coronal", wrongs: wrongs, rights: rights})
    },
    reset() {
      this.brainParts = [
        "putamen",
        "nigra",
        "internalCapsule",
        "hippocampus",
        "pons"
      ];
      this.isClicked = false;
      this.currentQuestion = null;
      this.currentAnswer = null;
      this.questionsArray = ["DE FAK IZ DIS", "NU FON WHO DIS", "Ha?", "What is this?"];
      this.userAnswer = null;
      this.answerStatus = null;
      this.answerColor = "#e32d3f";
      this.answerLen = 0;
      this.rights = [];
      this.wrongs = [];
      this.checking = false;
    }
  },
  watch: {
    userAnswer: {
      handler() {
        if (this.answerLen !== this.userAnswer.length) {
          document.querySelector(".question-card").style.backgroundColor = "#FFE3DC";
          this.checking = false;
        }
        if (this.userAnswer.toLowerCase() === this.currentAnswer.toLowerCase()) {
          this.answerColor = "#b2fcbb"
        } else {
          this.answerColor = "#e32d3f"
        }
        this.answerLen = this.userAnswer.length
      }
    }
  }
}
</script>

